window.bookSummaryJSON = "<p>Natalie Long is missing. About to board a high-speed train from London’s Paddington station, she has vanished without a trace. Just two days earlier, things were so different.&nbsp;</p> <p>One of eight candidates staying at an exclusive West London property, Natalie was competing for the chance of a lifetime - a career at one of the world’s most dynamic and mysterious companies, Brand New. For Detective Chief Inspector Paul Cullen of the British Transport Police, the case is personal. Natalie is good friends with his daughter, Amy, who is certain Natalie is in great danger. Something terrible did happen that weekend. And the time for answers is running out. But can DCI Cullen uncover the truth before it is too late?&nbsp;&nbsp;</p>"; 
